INSERT INTO gz_templates VALUES('346','metx5_mobile','1','3','8','3','','about_content','<div style=\"color: rgb(51, 51, 51); font-size: 12px; line-height: 24px; padding-top: 10px; background-color: rgb(255, 255, 255);\">\r\n	<span style=\"font-size: 14px;\"><strong>关于&ldquo;为合作伙伴创造价值&rdquo;</strong></span></div>\r\n<div style=\"color: rgb(51, 51, 51); font-size: 12px; line-height: 24px; background-color: rgb(255, 255, 255);\">\r\n	米拓信息认为客户、供应商、公司股东、公司员工等一切和自身有合作关系的单位和个人都是自己的合作伙伴，并只有通过努力为合作伙伴创造价值，才能体现自身的价值并获得发展和成功。<br />\r\n	<br />\r\n	<div>\r\n		<span style=\"font-size: 14px;\"><strong>关于&ldquo;诚实、宽容、创新、服务&rdquo;</strong></span></div>\r\n	<div>\r\n		米拓信息认为诚信是一切合作的基础，宽容是解决问题的前提，创新是发展事业的利器，服务是创造价值的根本。</div>\r\n</div>\r\n<br />\r\n','','简介内容','','cn');
